import React from 'react';

import hero from '../../../public/imgs/sentinel.jpg';
import styles from './Hero.module.scss';

export default function Hero() {
  return (
    <div>
      <img src={hero} alt='hero' className={styles.hero_image} />
    </div>
  );
}
